{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "cd frontend",
        "npm ci",
        "npm run build",
        "aws s3 cp ./src/build s3://$BUCKET_NAME/frontend --recursive",
        "aws cloudfront create-invalidation --distribution-id $DISTRIBUTION_ID --paths \"/*\""
      ]
    }
  }
}
